import React from "react";
import Button from "@material-ui/core/Button";

const App = () => (
    <Button variant="contained" color="primary">
        Hello World
        <Button variant="contained" color="primary">
            Hello World
            <Button variant="contained" color="primary">
                Hello World
                <Button variant="contained" color="primary">
                    Hello World
                    <Button variant="contained" color="primary">
                        Hello World

                    </Button>
                </Button>
            </Button>
        </Button>
    </Button>
);

export default App;
